    [],nt"revision_timestamp": "2015-09-26T21:49:15.263766",nt"name": "historical-wban-id-assignments",nt"isopen":
    false,nt"url": null,nt"notes": "4"x6" index cards represent the first
    written assignments of Weather Bureau Army Navy (WBAN) station identifier numbers
    by the National Climatic Data Center. Established in the 1950s, WBAN numbers were
    the first major attempt at a coordinated station numbering scheme among several
    weather reporting authorities. Original participants in the WBAN number plans were
    the United States Weather Bureau, Air Force, Navy, and Army, and the Canadian Department
    of Transportation. Selected German and Korean stations in close cooperation with
    the US Weather Services are also included. The 295 documents include one for every
    region, represented by the first three digits of the WBAN ID. Many more IDs have
    been issued since this original list was created, as new stations have been established
    around the world.",nt"license_title": null,nt"extras": [{ntt"key":
